/*Table structure for table `qm_checktype_info` */

DROP TABLE IF EXISTS `qm_checktype_info`;

CREATE TABLE `qm_checktype_info` (
  `id` char(32) NOT NULL COMMENT 'id',
  `check_type_code` varchar(20) NOT NULL COMMENT '检验项分类编号',
  `check_type_name` varchar(50) NOT NULL COMMENT '检验项分类名称',
  `check_technique` varchar(15) DEFAULT NULL COMMENT '检验技术方法',
  `record_type` varchar(15) DEFAULT NULL COMMENT '记录类型',
  `check_requirements` varchar(255) DEFAULT NULL COMMENT '检验要求',
  `status` varchar(4) DEFAULT NULL COMMENT '使用状态',
  `create_user` varchar(32) DEFAULT NULL COMMENT 'create_user',
  `create_time` datetime DEFAULT NULL COMMENT 'create_time',
  `update_user` varchar(32) DEFAULT NULL COMMENT 'update_user',
  `update_time` datetime DEFAULT NULL COMMENT 'update_time',
  `remark` varchar(255) DEFAULT NULL COMMENT 'remark',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='质检项分类';

