/*Table structure for table `qm_scheme_info` */

DROP TABLE IF EXISTS `qm_scheme_info`;

CREATE TABLE `qm_scheme_info` (
  `id` char(32) NOT NULL COMMENT 'id',
  `scheme_code` varchar(20) NOT NULL COMMENT '质检方案编码',
  `scheme_name` varchar(50) NOT NULL COMMENT '质检方案名称',
  `check_type` varchar(15) NOT NULL COMMENT '检验类型',
  `check_material` varchar(20) DEFAULT NULL COMMENT '检测产品',
  `product_process` varchar(20) DEFAULT NULL COMMENT '生产工序',
  `check_range` varchar(15) NOT NULL COMMENT '检测范围',
  `sample_method` varchar(15) DEFAULT NULL COMMENT '抽样方式',
  `sample_cycle` char(15) DEFAULT NULL COMMENT '抽样周期',
  `sample_rate` decimal(10,3) DEFAULT NULL COMMENT '抽样率',
  `technical_method` varchar(20) NOT NULL COMMENT '检验技术方法',
  `sample_rule` varchar(200) DEFAULT NULL COMMENT '抽样规则',
  `check_strategy_desc` varchar(200) DEFAULT NULL COMMENT '质检策略说明',
  `status` varchar(4) NOT NULL COMMENT '使用状态',
  `create_user` varchar(32) NOT NULL COMMENT '操作人',
  `create_time` datetime DEFAULT NULL COMMENT '操作时间',
  `update_user` varchar(32) DEFAULT NULL COMMENT '修改人',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `version_no` varchar(20) DEFAULT NULL COMMENT '版本号',
  `tmpl_path` varchar(50) DEFAULT NULL COMMENT '对应模板路径',
  `remark` varchar(255) DEFAULT NULL COMMENT 'remark',
  `sample_interval_num` varchar(10) DEFAULT NULL COMMENT '抽样间隔编号数',
  `sample_time_unit` varchar(10) DEFAULT NULL COMMENT '抽样检查时间频率单位',
  `sample_time_rate` varchar(10) DEFAULT NULL COMMENT '抽样检查时间频率',
  `sample_yield_rate` varchar(10) DEFAULT NULL COMMENT '抽样检查产量频率',
  `sample_yield_unit` varchar(20) DEFAULT NULL COMMENT '抽样检查产量频率单位',
  `must_check` varchar(5) DEFAULT NULL COMMENT '是否必检',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

