/*Table structure for table `qm_technicrecord_info` */

DROP TABLE IF EXISTS `qm_technicrecord_info`;

CREATE TABLE `qm_technicrecord_info` (
  `id` char(32) NOT NULL COMMENT 'id',
  `technic_code` varchar(50) DEFAULT NULL COMMENT '工艺编号',
  `pro_technic_type` varchar(15) DEFAULT NULL COMMENT '生产工艺类型',
  `pro_order_code` varchar(32) DEFAULT NULL COMMENT '生产订单编号',
  `design_date` date DEFAULT NULL COMMENT '设计时间',
  `design_persion` varchar(20) DEFAULT NULL COMMENT '设计人',
  `review_persion` varchar(20) DEFAULT NULL COMMENT '复核人',
  `audit_persion` char(10) DEFAULT NULL COMMENT '审批人',
  `pro_assortment` varchar(150) DEFAULT NULL COMMENT '生产品种',
  `status` tinyint(4) DEFAULT NULL COMMENT 'status',
  `create_user` varchar(32) DEFAULT NULL COMMENT 'create_user',
  `create_time` datetime DEFAULT NULL COMMENT 'create_time',
  `update_user` varchar(32) DEFAULT NULL COMMENT 'update_user',
  `update_time` datetime DEFAULT NULL COMMENT 'update_time',
  `remark` varchar(255) DEFAULT NULL COMMENT 'remark',
  `procedure` varchar(32) DEFAULT NULL COMMENT '工序',
  `handle_Time` datetime DEFAULT NULL COMMENT '设计时间',
  `technology_belong` varchar(32) DEFAULT NULL COMMENT '所属大工艺',
  `semi_finished` varchar(32) DEFAULT NULL COMMENT '半成品',
  `row_number` varchar(10) DEFAULT NULL COMMENT '织造工艺组织图行数',
  `col_number` varchar(10) DEFAULT NULL COMMENT '织造工艺组织图列数',
  `selected_area` varchar(300) DEFAULT NULL COMMENT '织造工艺组织图选中区域',
  `pro_assortment_name` varchar(300) DEFAULT '' COMMENT '生产品种名称',
  `semi_finished_name` varchar(300) DEFAULT NULL COMMENT '半成品名称',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='工艺设计信息';

