CREATE TABLE `qm_traceability_result_info` (
  `id` char(32) NOT NULL COMMENT 'id',
  `traceability_id` varchar(32) NOT NULL COMMENT '质量追溯任务ID',
  `deal_way` varchar(15) DEFAULT NULL COMMENT '处理方式',
